import React from 'react';
import './App.css';

// Components
import {
  Container,
  Card,
  CardHeader,
  CardBody
} from 'reactstrap';

function App() {
  return (
    <Container style={{
      maxWidth: 900,
      margin: '0 auto',
      padding: '50px 0',
    }}>
      <Card>
        <CardHeader></CardHeader>
        <CardBody></CardBody>
      </Card>
    </Container>
  );
}

export default App;
